Bass Dynasty meet Landon Rickert, CEO of @universalbassin! UB currently sits at 215,000+ followers, making them one of the largest Bass fishing influencers on Social Media! We have had the pleasure of working with Landon over the past year and excited to announce that we have partnered together in several new upcoming ventures! Very impressive to see such a young man doing such incredible things. Congratulations on your successes Landon and looking forward to working together in the future!
